import React from 'react';

const ImageList = (props) => (
  props.images.map(image =>
      <a href="https://www.w3schools.com">
      <img
        className='thumbnail'
        key={image.id}
        src={image.image_url}
        alt={image.id}
      />
    </a>
    )
)

export default ImageList
